// ===================== UI BASE COMPONENTS =====================
const Card = ({ children, className = '' }) => (
  <div style={{background:'#1e1e1e',border:'1px solid rgba(255,255,255,0.1)',borderRadius:'12px',padding:'24px',boxShadow:'0 4px 24px rgba(0,0,0,0.4)'}} className={className}>
    {children}
  </div>
);

const Button = ({ children, onClick, variant = 'primary', disabled = false, className = '', type = 'button', style = {} }) => {
  const base = { padding:'10px 20px', fontWeight:600, borderRadius:'8px', cursor:disabled?'not-allowed':'pointer', display:'inline-flex', alignItems:'center', justifyContent:'center', gap:'8px', fontSize:'14px', border:'none', transition:'all 0.2s', opacity:disabled?0.5:1, ...style };
  const variants = {
    primary: { background:'#f9b248', color:'#1a1a1a' },
    secondary: { background:'transparent', color:'white', border:'1px solid rgba(255,255,255,0.3)' },
    danger: { background:'transparent', color:'#f87171', border:'1px solid rgba(248,113,113,0.4)' },
  };
  return <button type={type} onClick={onClick} disabled={disabled} style={{...base,...variants[variant]}} className={className}>{children}</button>;
};

const Input = ({ label, id, className = '', ...props }) => (
  <div style={{marginBottom:0}} className={className}>
    {label && <label htmlFor={id} style={{display:'block',fontSize:'13px',fontWeight:300,color:'#aaa',marginBottom:'6px'}}>{label}</label>}
    <input id={id} {...props} style={{width:'100%',background:'#1e1e1e',border:'1px solid rgba(255,255,255,0.25)',borderRadius:'8px',padding:'8px 14px',color:'white',fontSize:'14px',boxSizing:'border-box',outline:'none'}} />
  </div>
);

const Textarea = ({ label, id, className = '', rows = 3, ...props }) => (
  <div style={{marginBottom:0}} className={className}>
    {label && <label htmlFor={id} style={{display:'block',fontSize:'13px',fontWeight:300,color:'#aaa',marginBottom:'6px'}}>{label}</label>}
    <textarea id={id} rows={rows} {...props} style={{width:'100%',background:'#1e1e1e',border:'1px solid rgba(255,255,255,0.25)',borderRadius:'8px',padding:'8px 14px',color:'white',fontSize:'14px',resize:'vertical',boxSizing:'border-box',outline:'none'}} />
  </div>
);

const Select = ({ label, id, children, className = '', ...props }) => (
  <div className={className}>
    {label && <label htmlFor={id} style={{display:'block',fontSize:'13px',fontWeight:300,color:'#aaa',marginBottom:'6px'}}>{label}</label>}
    <select id={id} {...props} style={{width:'100%',background:'#1e1e1e',border:'1px solid rgba(255,255,255,0.25)',borderRadius:'8px',padding:'8px 14px',color:'white',fontSize:'14px',appearance:'none',outline:'none',boxSizing:'border-box'}}>
      {children}
    </select>
  </div>
);

// ===================== EVENT DETAIL MODAL =====================
function EventDetailModal({ event, onClose, onUpdateEvent, allPackages }) {
  if (!event) return null;
  const client = CLIENTS.find(c => c.id === event.clientId);
  const pkg = allPackages.get(event.packageId);

  return (
    <div onClick={onClose} style={{position:'fixed',inset:0,background:'rgba(0,0,0,0.75)',display:'flex',alignItems:'center',justifyContent:'center',zIndex:50,padding:'16px'}}>
      <div onClick={e => e.stopPropagation()} style={{background:'#1e1e1e',border:'1px solid rgba(255,255,255,0.1)',borderRadius:'16px',width:'100%',maxWidth:'680px',maxHeight:'90vh',overflowY:'auto',position:'relative'}}>
        <button onClick={onClose} style={{position:'absolute',top:'16px',right:'16px',background:'none',border:'none',color:'#aaa',cursor:'pointer'}}>
          <XIcon style={{width:'24px',height:'24px'}} />
        </button>
        <div style={{padding:'32px'}}>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'#f9b248',marginBottom:'4px'}}>{event.eventType}</h2>
          <p style={{fontSize:'18px',fontWeight:600,color:'white',marginBottom:'24px'}}>{client?.name || 'Cliente não encontrado'}</p>
          <div style={{display:'grid',gridTemplateColumns:'1fr 1fr',gap:'32px 40px'}}>
            <div>
              <h3 style={{fontSize:'16px',fontWeight:300,color:'white',borderBottom:'1px solid rgba(255,255,255,0.1)',paddingBottom:'8px',marginBottom:'12px'}}>Detalhes do Evento</h3>
              {[
                ['Cliente', client?.name || 'N/A'],
                ['Data', event.date.toLocaleString('pt-BR', {dateStyle:'full', timeStyle:'short'})],
                ['Local', event.location || 'Não especificado'],
                ['Pacote', pkg?.name || 'Não encontrado'],
                ['Status Pag.', event.paymentStatus],
                ['Contrato', event.contractSigned ? 'Assinado' : 'Pendente'],
              ].map(([k, v]) => (
                <div key={k} style={{display:'flex',gap:'8px',marginBottom:'10px',fontSize:'13px'}}>
                  <span style={{width:'90px',flexShrink:0,fontWeight:600,color:'#999'}}>{k}</span>
                  <span style={{color:k==='Status Pag.' ? (event.paymentStatus===PaymentStatus.Pago?'#4ade80':'#fbbf24') : k==='Contrato' ? (event.contractSigned?'#4ade80':'#fbbf24') : 'white'}}>{v}</span>
                </div>
              ))}
              {event.notes && <div style={{marginTop:'8px'}}><div style={{fontSize:'13px',fontWeight:600,color:'#999',marginBottom:'4px'}}>Notas</div><p style={{background:'#121212',padding:'10px',borderRadius:'6px',fontSize:'13px',fontWeight:300,color:'white'}}>{event.notes}</p></div>}
            </div>
            <div>
              <h3 style={{fontSize:'16px',fontWeight:300,color:'white',borderBottom:'1px solid rgba(255,255,255,0.1)',paddingBottom:'8px',marginBottom:'16px'}}>Acompanhamento</h3>
              <div style={{marginBottom:'16px'}}>
                <Select label="Situação do Trabalho" id="work-status" value={event.workStatus || ''} onChange={e => onUpdateEvent({...event, workStatus:e.target.value, workStatusUpdatedAt:new Date()})}>
                  <option value="" disabled>Selecione...</option>
                  {Object.values(WorkStatus).map(s => <option key={s} value={s}>{s}</option>)}
                </Select>
                <p style={{fontSize:'11px',color:'#555',marginTop:'4px'}}>{event.workStatusUpdatedAt ? `Atualizado em: ${event.workStatusUpdatedAt.toLocaleDateString('pt-BR')}` : 'Sem atualização'}</p>
              </div>
              {pkg?.hasAlbum && (
                <div>
                  <Select label="Situação do Álbum" id="album-status" value={event.albumStatus || ''} onChange={e => onUpdateEvent({...event, albumStatus:e.target.value, albumStatusUpdatedAt:new Date()})}>
                    <option value="" disabled>Selecione...</option>
                    {Object.values(AlbumStatus).map(s => <option key={s} value={s}>{s}</option>)}
                  </Select>
                  <p style={{fontSize:'11px',color:'#555',marginTop:'4px'}}>{event.albumStatusUpdatedAt ? `Atualizado em: ${event.albumStatusUpdatedAt.toLocaleDateString('pt-BR')}` : 'Sem atualização'}</p>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

// ===================== ADMIN DASHBOARD =====================
function AdminDashboard({ events, clients, allPackages }) {
  const monthlyRevenue = useMemo(() => {
    const data = {};
    events.filter(e => e.paymentStatus === PaymentStatus.Pago).forEach(e => {
      const month = e.date.toLocaleString('default', {month:'short', year:'2-digit'});
      data[month] = (data[month] || 0) + e.totalPaid;
    });
    return Object.entries(data).map(([name, Faturamento]) => ({name, Faturamento}));
  }, [events]);

  const packagePopularity = useMemo(() => {
    const data = {};
    events.forEach(e => {
      const name = allPackages.get(e.packageId)?.name || 'Desconhecido';
      data[name] = (data[name] || 0) + 1;
    });
    return Object.entries(data).map(([name, value]) => ({name, value}));
  }, [events, allPackages]);

  const PIE_COLORS = ['#f9b248','#f87171','#60a5fa','#a78bfa'];
  const totalRevenue = events.filter(e => e.paymentStatus === PaymentStatus.Pago).reduce((s,e) => s + e.totalPaid, 0);
  const pendingPayments = events.filter(e => e.paymentStatus === PaymentStatus.Pendente).length;

  return (
    <div>
      <h1 style={{fontSize:'28px',fontWeight:300,color:'white',marginBottom:'24px'}}>Dashboard</h1>
      <div style={{display:'grid',gridTemplateColumns:'repeat(3,1fr)',gap:'20px',marginBottom:'24px'}}>
        {[
          ['Faturamento Total', totalRevenue.toLocaleString('pt-BR',{style:'currency',currency:'BRL'}), '#4ade80'],
          ['Eventos Futuros', events.filter(e => e.date > new Date()).length, '#60a5fa'],
          ['Pagamentos Pendentes', pendingPayments, '#fbbf24'],
        ].map(([label, val, color]) => (
          <Card key={label} style={{textAlign:'center'}}>
            <p style={{color:'#aaa',fontSize:'14px',fontWeight:300,marginBottom:'8px'}}>{label}</p>
            <p style={{fontSize:'32px',fontWeight:600,color}}>{val}</p>
          </Card>
        ))}
      </div>
      <div style={{display:'grid',gridTemplateColumns:'3fr 2fr',gap:'20px'}}>
        <Card>
          <h3 style={{fontSize:'18px',fontWeight:300,color:'white',marginBottom:'16px'}}>Faturamento Mensal</h3>
          <ResponsiveContainer width="100%" height={280}>
            <BarChart data={monthlyRevenue}>
              <XAxis dataKey="name" stroke="#aaa" tick={{fill:'#e0e0e0',fontSize:12}} />
              <YAxis stroke="#aaa" tickFormatter={v => `R$${v/1000}k`} tick={{fill:'#e0e0e0',fontSize:12}} />
              <Tooltip contentStyle={{backgroundColor:'#1e1e1e',border:'1px solid rgba(255,255,255,0.2)'}} cursor={{fill:'rgba(255,255,255,0.05)'}} />
              <Legend wrapperStyle={{color:'#e0e0e0'}} />
              <Bar dataKey="Faturamento" fill="#f9b248" />
            </BarChart>
          </ResponsiveContainer>
        </Card>
        <Card>
          <h3 style={{fontSize:'18px',fontWeight:300,color:'white',marginBottom:'16px'}}>Pacotes Mais Vendidos</h3>
          <ResponsiveContainer width="100%" height={280}>
            <PieChart>
              <Pie data={packagePopularity} dataKey="value" nameKey="name" cx="50%" cy="50%" outerRadius={90} label={({name,percent}) => `${name} ${(percent*100).toFixed(0)}%`} labelLine={false}>
                {packagePopularity.map((_, i) => <Cell key={i} fill={PIE_COLORS[i % PIE_COLORS.length]} />)}
              </Pie>
              <Tooltip contentStyle={{backgroundColor:'#1e1e1e',border:'1px solid rgba(255,255,255,0.2)'}} />
            </PieChart>
          </ResponsiveContainer>
        </Card>
      </div>
    </div>
  );
}

// ===================== ADMIN AGENDA =====================
function AdminAgenda({ events, onEventClick }) {
  const [currentDate, setCurrentDate] = useState(new Date());
  const startOfMonth = new Date(currentDate.getFullYear(), currentDate.getMonth(), 1);
  const endOfMonth = new Date(currentDate.getFullYear(), currentDate.getMonth() + 1, 0);
  const startDate = new Date(startOfMonth);
  startDate.setDate(startDate.getDate() - startDate.getDay());
  const endDate = new Date(endOfMonth);
  if (endDate.getDay() !== 6) endDate.setDate(endDate.getDate() + (6 - endDate.getDay()));
  const days = [];
  let d = new Date(startDate);
  while (d <= endDate) { days.push(new Date(d)); d.setDate(d.getDate() + 1); }

  const eventsByDate = useMemo(() => {
    const map = new Map();
    events.forEach(ev => {
      let cur = new Date(ev.date); cur.setHours(0,0,0,0);
      if (ev.endDate) {
        while (cur <= ev.endDate) {
          const key = cur.toISOString().split('T')[0];
          if (!map.has(key)) map.set(key, []);
          map.get(key).push(ev);
          cur.setDate(cur.getDate() + 1);
        }
      }
    });
    return map;
  }, [events]);

  return (
    <div>
      <h1 style={{fontSize:'28px',fontWeight:300,color:'white',marginBottom:'24px'}}>Agenda</h1>
      <Card>
        <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:'16px'}}>
          <Button variant="secondary" onClick={() => setCurrentDate(new Date(currentDate.getFullYear(), currentDate.getMonth()-1, 1))}>Anterior</Button>
          <h2 style={{fontSize:'18px',fontWeight:400,color:'white'}}>{currentDate.toLocaleString('pt-BR',{month:'long',year:'numeric'})}</h2>
          <Button variant="secondary" onClick={() => setCurrentDate(new Date(currentDate.getFullYear(), currentDate.getMonth()+1, 1))}>Próximo</Button>
        </div>
        <div style={{display:'grid',gridTemplateColumns:'repeat(7,1fr)',gap:'1px',background:'rgba(255,255,255,0.15)',border:'1px solid rgba(255,255,255,0.15)'}}>
          {['Dom','Seg','Ter','Qua','Qui','Sex','Sáb'].map(dy => (
            <div key={dy} style={{textAlign:'center',padding:'8px 0',background:'#1e1e1e',color:'#aaa',fontSize:'13px'}}>{dy}</div>
          ))}
          {days.map(day => {
            const key = day.toISOString().split('T')[0];
            const dayEvents = eventsByDate.get(key) || [];
            const isCurrentMonth = day.getMonth() === currentDate.getMonth();
            const isToday = day.toDateString() === new Date().toDateString();
            return (
              <div key={day.toString()} style={{padding:'6px',minHeight:'100px',background:isCurrentMonth?'#1e1e1e':'#121212',display:'flex',flexDirection:'column'}}>
                <span style={{fontSize:'14px',color:isToday?'#1a1a1a':(isCurrentMonth?'white':'#555'),background:isToday?'#f9b248':'transparent',width:isToday?'26px':'auto',height:isToday?'26px':'auto',borderRadius:'50%',display:'flex',alignItems:'center',justifyContent:'center',fontWeight:isToday?600:400}}>
                  {day.getDate()}
                </span>
                <div style={{marginTop:'4px',overflow:'hidden',flex:1}}>
                  {dayEvents.map(ev => {
                    const isCont = key !== ev.date.toISOString().split('T')[0];
                    return (
                      <div key={ev.id} onClick={() => onEventClick(ev)} style={{background:'rgba(239,68,68,0.2)',border:'1px solid rgba(239,68,68,0.3)',color:'#fca5a5',padding:'2px 5px',borderRadius:'4px',fontSize:'11px',marginBottom:'2px',cursor:'pointer'}}>
                        {CLIENTS.find(c => c.id === ev.clientId)?.name.split(' ')[0]} - {isCont?'Continuação':ev.date.toLocaleTimeString('pt-BR',{hour:'2-digit',minute:'2-digit'})}
                      </div>
                    );
                  })}
                </div>
              </div>
            );
          })}
        </div>
      </Card>
    </div>
  );
}

// ===================== EVENT TABLE =====================
function EventTable({ title, events, onEventClick, allPackages }) {
  const chip = (status) => {
    if (status === PaymentStatus.Pago) return <span style={{padding:'2px 8px',borderRadius:'999px',background:'rgba(74,222,128,0.15)',color:'#4ade80',fontSize:'11px',fontWeight:600}}>Pago</span>;
    if (status === PaymentStatus.Atrasado) return <span style={{padding:'2px 8px',borderRadius:'999px',background:'rgba(248,113,113,0.15)',color:'#f87171',fontSize:'11px',fontWeight:600}}>Atrasado</span>;
    return <span style={{padding:'2px 8px',borderRadius:'999px',background:'rgba(251,191,36,0.15)',color:'#fbbf24',fontSize:'11px',fontWeight:600}}>Pendente</span>;
  };
  const workChip = (s) => {
    if (!s) return <span style={{color:'#555'}}>Não iniciado</span>;
    return <span style={{color:s===WorkStatus.Entregue?'#4ade80':'#93c5fd'}}>{s}</span>;
  };
  const albumChip = (s) => {
    if (!s) return <span style={{color:'#555'}}>Aguardando</span>;
    return <span style={{color:s===AlbumStatus.Entregue?'#4ade80':'#93c5fd'}}>{s}</span>;
  };

  return (
    <div>
      <h1 style={{fontSize:'28px',fontWeight:300,color:'white',marginBottom:'24px'}}>{title}</h1>
      <Card style={{overflowX:'auto'}}>
        <table style={{width:'100%',minWidth:'1100px',borderCollapse:'collapse',textAlign:'left'}}>
          <thead>
            <tr style={{borderBottom:'1px solid rgba(255,255,255,0.15)'}}>
              {['Cliente','Evento','Data','Pag.','Contrato','Situação Trabalho','Situação Álbum'].map(h => (
                <th key={h} style={{padding:'12px 16px',fontWeight:400,color:'#aaa',fontSize:'13px'}}>{h}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {events.map(ev => {
              const client = CLIENTS.find(c => c.id === ev.clientId);
              const pkg = allPackages.get(ev.packageId);
              return (
                <tr key={ev.id} onClick={() => onEventClick?.(ev)} style={{borderBottom:'1px solid rgba(255,255,255,0.08)',cursor:onEventClick?'pointer':'default',transition:'background 0.15s'}}>
                  <td style={{padding:'12px 16px',color:'white',fontSize:'14px'}}>{client?.name}</td>
                  <td style={{padding:'12px 16px',fontSize:'14px'}}><span style={{color:'white'}}>{ev.eventType}</span><br/><span style={{color:'#555',fontSize:'11px'}}>{pkg?.name || 'N/A'}</span></td>
                  <td style={{padding:'12px 16px',color:'#ddd',fontSize:'13px'}}>{ev.date.toLocaleString('pt-BR',{dateStyle:'short',timeStyle:'short'})}</td>
                  <td style={{padding:'12px 16px'}}>{chip(ev.paymentStatus)}</td>
                  <td style={{padding:'12px 16px',fontSize:'13px'}}>
                    {ev.contractSigned ? <span style={{color:'#4ade80',display:'flex',alignItems:'center',gap:'4px'}}><CheckIcon style={{width:'14px',height:'14px'}} />Assinado</span> : <span style={{color:'#fbbf24',display:'flex',alignItems:'center',gap:'4px'}}><AlertIcon style={{width:'14px',height:'14px'}} />Pendente</span>}
                  </td>
                  <td style={{padding:'12px 16px',fontSize:'13px'}}>{workChip(ev.workStatus)}<br/><span style={{color:'#555',fontSize:'11px'}}>{ev.workStatusUpdatedAt?.toLocaleDateString('pt-BR')}</span></td>
                  <td style={{padding:'12px 16px',fontSize:'13px'}}>{pkg?.hasAlbum ? albumChip(ev.albumStatus) : <span style={{color:'#555'}}>N/A</span>}<br/>{pkg?.hasAlbum && <span style={{color:'#555',fontSize:'11px'}}>{ev.albumStatusUpdatedAt?.toLocaleDateString('pt-BR')}</span>}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </Card>
    </div>
  );
}

// ===================== ADMIN SETTINGS =====================
function AdminSettings({ offerings, setOfferings, homePageContent, setHomePageContent }) {
  const [activeTab, setActiveTab] = useState('packages');
  const [localOfferings, setLocalOfferings] = useState(offerings);
  const [localHome, setLocalHome] = useState(homePageContent);
  const [selectedType, setSelectedType] = useState(EventType.Casamento);
  useEffect(() => setLocalOfferings(offerings), [offerings]);
  useEffect(() => setLocalHome(homePageContent), [homePageContent]);

  const hasChanges = useMemo(() => {
    try { return JSON.stringify(localOfferings) !== JSON.stringify(offerings) || JSON.stringify(localHome) !== JSON.stringify(homePageContent); }
    catch { return false; }
  }, [localOfferings, offerings, localHome, homePageContent]);

  const handleSave = () => { setOfferings(localOfferings); setHomePageContent(localHome); };
  const handleDiscard = () => { if (window.confirm('Descartar alterações?')) { setLocalOfferings(offerings); setLocalHome(homePageContent); } };
  const updateOffering = (data) => setLocalOfferings(prev => ({...prev, [selectedType]: {...(prev[selectedType]||{packages:[],addons:[]}), ...data}}));

  const handlePkgChange = (i, field, val) => {
    const pkgs = [...localOfferings[selectedType].packages];
    pkgs[i] = {...pkgs[i], [field]: val};
    updateOffering({packages: pkgs});
  };
  const handleFeatChange = (pi, fi, val) => {
    const pkgs = [...localOfferings[selectedType].packages];
    const feats = [...pkgs[pi].features]; feats[fi] = val;
    pkgs[pi] = {...pkgs[pi], features: feats};
    updateOffering({packages: pkgs});
  };
  const addFeature = (pi) => { const pkgs = [...localOfferings[selectedType].packages]; pkgs[pi].features.push('Nova característica'); updateOffering({packages: pkgs}); };
  const removeFeature = (pi, fi) => { const pkgs = [...localOfferings[selectedType].packages]; pkgs[pi].features.splice(fi,1); updateOffering({packages:[...pkgs]}); };
  const addPackage = () => updateOffering({packages:[...localOfferings[selectedType].packages,{id:Date.now(),name:'Novo Pacote',price:0,description:'Descrição',features:['1 Fotógrafo'],hasAlbum:false}]});
  const removePackage = (id) => { if(window.confirm('Remover pacote?')) updateOffering({packages:localOfferings[selectedType].packages.filter(p=>p.id!==id)}); };
  const handleAddonChange = (i, field, val) => { const a=[...localOfferings[selectedType].addons]; a[i]={...a[i],[field]:val}; updateOffering({addons:a}); };
  const addAddon = () => updateOffering({addons:[...localOfferings[selectedType].addons,{id:Date.now(),name:'Novo Adicional',price:0,description:''}]});
  const removeAddon = (id) => { if(window.confirm('Remover adicional?')) updateOffering({addons:localOfferings[selectedType].addons.filter(a=>a.id!==id)}); };

  const cur = localOfferings[selectedType];
  const tabStyle = (t) => ({padding:'10px 16px',fontSize:'14px',fontWeight:500,background:'none',border:'none',cursor:'pointer',color:activeTab===t?'#f9b248':'#aaa',borderBottom:activeTab===t?'2px solid #f9b248':'2px solid transparent',transition:'color 0.2s'});

  return (
    <div>
      <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:'24px'}}>
        <h1 style={{fontSize:'28px',fontWeight:300,color:'white'}}>Configurações</h1>
        {hasChanges && (
          <div style={{display:'flex',gap:'12px'}}>
            <Button variant="secondary" onClick={handleDiscard}>Descartar</Button>
            <Button onClick={handleSave}>Salvar Alterações</Button>
          </div>
        )}
      </div>
      <div style={{display:'flex',borderBottom:'1px solid rgba(255,255,255,0.1)',marginBottom:'32px'}}>
        <button style={tabStyle('packages')} onClick={() => setActiveTab('packages')}>Pacotes e Adicionais</button>
        <button style={tabStyle('homepage')} onClick={() => setActiveTab('homepage')}>Página Inicial</button>
      </div>

      {activeTab === 'packages' && (
        <>
          <Card style={{marginBottom:'24px'}}>
            <Select label="Tipo de evento" id="evt-sel" value={selectedType} onChange={e=>setSelectedType(e.target.value)}>
              {Object.values(EventType).map(t => <option key={t} value={t}>{t}</option>)}
            </Select>
          </Card>
          <div style={{marginBottom:'32px'}}>
            <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:'16px'}}>
              <h2 style={{fontSize:'22px',fontWeight:300,color:'white'}}>Pacotes de {selectedType}</h2>
              <Button variant="secondary" onClick={addPackage}><PlusCircleIcon style={{width:'16px',height:'16px'}} />Adicionar Pacote</Button>
            </div>
            <div style={{display:'flex',flexDirection:'column',gap:'16px'}}>
              {cur.packages.map((pkg, pi) => (
                <Card key={pkg.id} style={{background:'#121212'}}>
                  <div style={{display:'grid',gridTemplateColumns:'1fr 1fr',gap:'12px',marginBottom:'12px'}}>
                    <Input label="Nome" id={`pn-${pkg.id}`} value={pkg.name} onChange={e=>handlePkgChange(pi,'name',e.target.value)} />
                    <Input label="Preço" id={`pp-${pkg.id}`} type="number" value={pkg.price} onChange={e=>handlePkgChange(pi,'price',parseFloat(e.target.value)||0)} />
                    <Textarea label="Descrição" id={`pd-${pkg.id}`} value={pkg.description} onChange={e=>handlePkgChange(pi,'description',e.target.value)} className="col-span-2" rows={2} />
                    <Textarea label="Nota (Opcional)" id={`pnote-${pkg.id}`} value={pkg.note||''} onChange={e=>handlePkgChange(pi,'note',e.target.value)} className="col-span-2" rows={1} />
                  </div>
                  <label style={{display:'flex',alignItems:'center',gap:'10px',color:'white',fontWeight:300,marginBottom:'12px',cursor:'pointer'}}>
                    <input type="checkbox" checked={!!pkg.hasAlbum} onChange={e=>handlePkgChange(pi,'hasAlbum',e.target.checked)} />
                    Este pacote inclui álbum?
                  </label>
                  <div>
                    <p style={{fontSize:'13px',fontWeight:300,color:'#aaa',marginBottom:'8px'}}>Itens Inclusos</p>
                    {pkg.features.map((f, fi) => (
                      <div key={fi} style={{display:'flex',gap:'8px',marginBottom:'6px',alignItems:'center'}}>
                        <input value={f} onChange={e=>handleFeatChange(pi,fi,e.target.value)} style={{flex:1,background:'#1e1e1e',border:'1px solid rgba(255,255,255,0.2)',borderRadius:'6px',padding:'6px 10px',color:'white',fontSize:'13px',outline:'none'}} />
                        <button onClick={()=>removeFeature(pi,fi)} style={{background:'none',border:'none',color:'#f87171',cursor:'pointer'}}><TrashIcon style={{width:'14px',height:'14px'}} /></button>
                      </div>
                    ))}
                    <button onClick={()=>addFeature(pi)} style={{color:'#f9b248',background:'none',border:'none',cursor:'pointer',fontSize:'13px',display:'flex',alignItems:'center',gap:'4px',marginTop:'4px'}}><PlusCircleIcon style={{width:'14px',height:'14px'}} />Adicionar item</button>
                  </div>
                  <div style={{borderTop:'1px solid rgba(255,255,255,0.1)',paddingTop:'12px',marginTop:'16px',display:'flex',justifyContent:'flex-end'}}>
                    <Button variant="danger" onClick={()=>removePackage(pkg.id)}><TrashIcon style={{width:'14px',height:'14px'}} />Remover Pacote</Button>
                  </div>
                </Card>
              ))}
            </div>
          </div>
          <div>
            <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:'16px'}}>
              <h2 style={{fontSize:'22px',fontWeight:300,color:'white'}}>Adicionais de {selectedType}</h2>
              <Button variant="secondary" onClick={addAddon}><PlusCircleIcon style={{width:'16px',height:'16px'}} />Adicionar Adicional</Button>
            </div>
            <div style={{display:'flex',flexDirection:'column',gap:'16px'}}>
              {cur.addons.map((addon, ai) => (
                <Card key={addon.id} style={{background:'#121212'}}>
                  <div style={{display:'grid',gridTemplateColumns:'1fr 1fr',gap:'12px'}}>
                    <Input label="Nome" id={`an-${addon.id}`} value={addon.name} onChange={e=>handleAddonChange(ai,'name',e.target.value)} />
                    <Input label="Preço" id={`ap-${addon.id}`} type="number" value={addon.price} onChange={e=>handleAddonChange(ai,'price',parseFloat(e.target.value)||0)} />
                    <Textarea label="Descrição" id={`ad-${addon.id}`} value={addon.description||''} onChange={e=>handleAddonChange(ai,'description',e.target.value)} className="col-span-2" rows={2} />
                  </div>
                  <div style={{borderTop:'1px solid rgba(255,255,255,0.1)',paddingTop:'12px',marginTop:'16px',display:'flex',justifyContent:'flex-end'}}>
                    <Button variant="danger" onClick={()=>removeAddon(addon.id)}><TrashIcon style={{width:'14px',height:'14px'}} />Remover Adicional</Button>
                  </div>
                </Card>
              ))}
            </div>
          </div>
        </>
      )}

      {activeTab === 'homepage' && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'24px'}}>Personalizar Página Inicial</h2>
          <div style={{display:'flex',flexDirection:'column',gap:'16px'}}>
            <Input label="Título Principal" id="ht" value={localHome.title} onChange={e=>setLocalHome(p=>({...p,title:e.target.value}))} />
            <Textarea label="Subtítulo" id="hs" rows={3} value={localHome.subtitle} onChange={e=>setLocalHome(p=>({...p,subtitle:e.target.value}))} />
            <Input label="URL da Imagem" id="hi" value={localHome.imageUrl} onChange={e=>setLocalHome(p=>({...p,imageUrl:e.target.value}))} />
            <div>
              <p style={{fontSize:'13px',color:'#aaa',marginBottom:'8px'}}>Pré-visualização</p>
              <img src={localHome.imageUrl} alt="preview" style={{width:'100%',maxHeight:'250px',objectFit:'cover',borderRadius:'8px',background:'#333'}} onError={e=>{e.target.src='https://placehold.co/600x300/1e1e1e/555?text=Imagem+inválida'}} />
            </div>
          </div>
        </Card>
      )}
    </div>
  );
}

// ===================== COUPON MANAGER =====================
function CouponManager({ coupons, setCoupons }) {
  const [form, setForm] = useState({code:'',discountValue:'',discountType:'percentage',startDate:'',endDate:''});
  const handleChange = e => setForm(p=>({...p,[e.target.name]:e.target.value}));
  const handleAdd = e => {
    e.preventDefault();
    if (!form.code||!form.discountValue||!form.startDate||!form.endDate) { alert('Preencha todos os campos.'); return; }
    setCoupons(p=>[...p,{id:Date.now(),code:form.code,discountValue:parseFloat(form.discountValue),discountType:form.discountType,isActive:true,startDate:form.startDate,endDate:form.endDate}]);
    setForm({code:'',discountValue:'',discountType:'percentage',startDate:'',endDate:''});
  };

  const getStatus = (c) => {
    const now = new Date(); now.setHours(0,0,0,0);
    if (!c.isActive) return <span style={{color:'#555'}}>Inativo</span>;
    if (now < new Date(c.startDate)) return <span style={{color:'#60a5fa'}}>Agendado</span>;
    if (now > new Date(c.endDate+'T23:59:59')) return <span style={{color:'#f87171'}}>Expirado</span>;
    return <span style={{color:'#4ade80'}}>Válido</span>;
  };

  return (
    <div style={{marginTop:'32px'}}>
      <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'24px'}}>Gerenciar Cupons</h2>
      <Card style={{marginBottom:'24px'}}>
        <h3 style={{fontSize:'18px',fontWeight:300,color:'white',marginBottom:'16px'}}>Criar Novo Cupom</h3>
        <form onSubmit={handleAdd}>
          <div style={{display:'grid',gridTemplateColumns:'repeat(3,1fr)',gap:'12px',marginBottom:'12px'}}>
            <Input label="Código" id="cc" name="code" value={form.code} onChange={handleChange} required />
            <Input label="Valor" id="cv" name="discountValue" type="number" value={form.discountValue} onChange={handleChange} required />
            <Select label="Tipo" id="ct" name="discountType" value={form.discountType} onChange={handleChange}>
              <option value="percentage">% (Porcentagem)</option>
              <option value="fixed">R$ (Fixo)</option>
            </Select>
          </div>
          <div style={{display:'grid',gridTemplateColumns:'1fr 1fr',gap:'12px',marginBottom:'12px'}}>
            <Input label="Data de Início" id="csd" name="startDate" type="date" value={form.startDate} onChange={handleChange} required />
            <Input label="Data de Término" id="ced" name="endDate" type="date" value={form.endDate} onChange={handleChange} required />
          </div>
          <div style={{display:'flex',justifyContent:'flex-end'}}>
            <Button type="submit"><PlusCircleIcon style={{width:'16px',height:'16px'}} />Adicionar Cupom</Button>
          </div>
        </form>
      </Card>
      <Card>
        <h3 style={{fontSize:'18px',fontWeight:300,color:'white',marginBottom:'16px'}}>Cupons Existentes</h3>
        <div style={{overflowX:'auto'}}>
          <table style={{width:'100%',minWidth:'580px',borderCollapse:'collapse',textAlign:'left'}}>
            <thead>
              <tr style={{borderBottom:'1px solid rgba(255,255,255,0.15)'}}>
                {['Código','Desconto','Validade','Status','Ações'].map(h => (
                  <th key={h} style={{padding:'10px 12px',fontWeight:400,color:'#aaa',fontSize:'13px',textAlign:h==='Ações'?'right':'left'}}>{h}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {coupons.map(c => (
                <tr key={c.id} style={{borderBottom:'1px solid rgba(255,255,255,0.07)'}}>
                  <td style={{padding:'10px 12px',fontWeight:600,color:'#f9b248',fontSize:'14px'}}>{c.code}</td>
                  <td style={{padding:'10px 12px',fontSize:'14px',color:'white'}}>{c.discountType==='fixed'?c.discountValue.toLocaleString('pt-BR',{style:'currency',currency:'BRL'}):`${c.discountValue}%`}</td>
                  <td style={{padding:'10px 12px',fontSize:'13px',color:'#ddd'}}>{new Date(c.startDate).toLocaleDateString('pt-BR')} - {new Date(c.endDate).toLocaleDateString('pt-BR')}</td>
                  <td style={{padding:'10px 12px',fontWeight:600}}>{getStatus(c)}</td>
                  <td style={{padding:'10px 12px',textAlign:'right',display:'flex',gap:'8px',justifyContent:'flex-end'}}>
                    <Button variant="secondary" style={{padding:'4px 10px',fontSize:'12px'}} onClick={()=>setCoupons(p=>p.map(x=>x.id===c.id?{...x,isActive:!x.isActive}:x))}>{c.isActive?'Desativar':'Ativar'}</Button>
                    <Button variant="danger" style={{padding:'4px 10px'}} onClick={()=>{if(window.confirm('Remover?'))setCoupons(p=>p.filter(x=>x.id!==c.id))}}><TrashIcon style={{width:'14px',height:'14px'}} /></Button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </Card>
    </div>
  );
}

// ===================== SIMPLE CALENDAR =====================
function SimpleCalendar({ onDateSelect, bookedDates }) {
  const [currentDate, setCurrentDate] = useState(new Date());
  const bookedStrings = useMemo(() => bookedDates.map(d => d.toISOString().split('T')[0]), [bookedDates]);
  const startOfMonth = new Date(currentDate.getFullYear(), currentDate.getMonth(), 1);
  const endOfMonth = new Date(currentDate.getFullYear(), currentDate.getMonth() + 1, 0);
  const startDate = new Date(startOfMonth);
  startDate.setDate(startDate.getDate() - startDate.getDay());
  const endDate = new Date(endOfMonth);
  if (endDate.getDay() !== 6) endDate.setDate(endDate.getDate() + (6 - endDate.getDay()));
  const days = [];
  let d = new Date(startDate);
  while (d <= endDate) { days.push(new Date(d)); d.setDate(d.getDate() + 1); }

  return (
    <div style={{padding:'12px'}}>
      <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:'16px'}}>
        <Button variant="secondary" onClick={() => setCurrentDate(new Date(currentDate.getFullYear(), currentDate.getMonth()-1, 1))} style={{padding:'6px 12px'}}>‹</Button>
        <h2 style={{fontSize:'18px',fontWeight:400,color:'white'}}>{currentDate.toLocaleString('pt-BR',{month:'long',year:'numeric'})}</h2>
        <Button variant="secondary" onClick={() => setCurrentDate(new Date(currentDate.getFullYear(), currentDate.getMonth()+1, 1))} style={{padding:'6px 12px'}}>›</Button>
      </div>
      <div style={{display:'grid',gridTemplateColumns:'repeat(7,1fr)',gap:'6px'}}>
        {['D','S','T','Q','Q','S','S'].map((l,i) => <div key={i} style={{textAlign:'center',color:'#aaa',fontSize:'13px',paddingBottom:'4px'}}>{l}</div>)}
        {days.map(day => {
          const key = day.toISOString().split('T')[0];
          const isBooked = bookedStrings.includes(key);
          const isPast = day < new Date(new Date().toDateString());
          const isCurrentMonth = day.getMonth() === currentDate.getMonth();
          const disabled = isBooked || isPast;
          return (
            <button key={day.toString()} disabled={disabled} onClick={() => onDateSelect(day)}
              style={{width:'100%',aspectRatio:'1',borderRadius:'50%',border:'none',cursor:disabled?'not-allowed':'pointer',background:'transparent',color:isBooked?'rgba(248,113,113,0.4)':isPast?'#444':isCurrentMonth?'white':'#555',textDecoration:isBooked?'line-through':'none',fontSize:'15px',fontWeight:300,transition:'all 0.15s'}}
              onMouseEnter={e => !disabled && (e.target.style.background='#f9b248',e.target.style.color='#1a1a1a')}
              onMouseLeave={e => !disabled && (e.target.style.background='transparent',e.target.style.color=isCurrentMonth?'white':'#555')}>
              {day.getDate()}
            </button>
          );
        })}
      </div>
    </div>
  );
}

// ===================== TIME SLOT SELECTOR =====================
function TimeSlotSelector({ selectedDate, onTimeSelect, onBack, bookedSlotsToday, bookedSlotsTomorrow }) {
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');
  const timeSlots = useMemo(() => Array.from({length:48},(_,i) => {
    const h = (Math.floor(i/2)+6)%24;
    const m = (i%2)*30;
    return `${h.toString().padStart(2,'0')}:${m.toString().padStart(2,'0')}`;
  }), []);

  const hasConflict = () => {
    if (!startTime || !endTime) return false;
    const sd = new Date(selectedDate); sd.setHours(parseInt(startTime.split(':')[0]),parseInt(startTime.split(':')[1]),0,0);
    const ed = new Date(selectedDate); ed.setHours(parseInt(endTime.split(':')[0]),parseInt(endTime.split(':')[1]),0,0);
    if (ed <= sd) ed.setDate(ed.getDate()+1);
    let cur = new Date(sd);
    while (cur < ed) {
      const ts = `${cur.getHours().toString().padStart(2,'0')}:${cur.getMinutes().toString().padStart(2,'0')}`;
      const curStr = cur.toISOString().split('T')[0];
      const sdStr = sd.toISOString().split('T')[0];
      if (curStr === sdStr && bookedSlotsToday.includes(ts)) return true;
      if (curStr !== sdStr && bookedSlotsTomorrow.includes(ts)) return true;
      cur.setMinutes(cur.getMinutes()+30);
    }
    return false;
  };
  const disabled = !startTime || !endTime || hasConflict();

  return (
    <div>
      <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'4px'}}>3. Selecione o horário</h2>
      <p style={{color:'#aaa',marginBottom:'24px',fontWeight:300}}>Data: {selectedDate.toLocaleDateString('pt-BR', {weekday:'long', day:'2-digit', month:'long'})}</p>
      <div style={{display:'grid',gridTemplateColumns:'1fr 1fr',gap:'16px',marginBottom:'16px'}}>
        <Select label="Horário de Início" id="st" value={startTime} onChange={e=>{setStartTime(e.target.value);setEndTime('')}}>
          <option value="" disabled>Selecione...</option>
          {timeSlots.map(t=><option key={t} value={t} disabled={bookedSlotsToday.includes(t)}>{t}{bookedSlotsToday.includes(t)?' (Ocupado)':''}</option>)}
        </Select>
        <Select label="Horário de Fim" id="et" value={endTime} onChange={e=>setEndTime(e.target.value)} disabled={!startTime}>
          <option value="" disabled>Selecione...</option>
          {timeSlots.map(t=><option key={t} value={t}>{t}</option>)}
        </Select>
      </div>
      {hasConflict() && <p style={{color:'#f87171',fontSize:'14px',textAlign:'center',marginBottom:'12px'}}>O período conflita com um horário já agendado.</p>}
      <div style={{display:'flex',justifyContent:'center',gap:'16px',marginTop:'24px'}}>
        <Button variant="secondary" onClick={onBack}>Voltar</Button>
        <Button onClick={() => onTimeSelect(startTime, endTime)} disabled={disabled}>Confirmar e Avançar</Button>
      </div>
    </div>
  );
}

