// ===================== BOOKING FLOW =====================
function BookingFlow({ onBookingComplete, events, initialEventType = null, initialPackage = null, onNavigateBack, eventOfferings, coupons }) {
  const [step, setStep] = useState(1);
  const [selectedDate, setSelectedDate] = useState(null);
  const [startTime, setStartTime] = useState(null);
  const [endTime, setEndTime] = useState(null);
  const [selectedEventType, setSelectedEventType] = useState(initialEventType);
  const [selectedPackage, setSelectedPackage] = useState(initialPackage);
  const [selectedAddons, setSelectedAddons] = useState([]);
  const [addonOptionSelections, setAddonOptionSelections] = useState({});
  const [isStepValid, setIsStepValid] = useState(false);
  const [eventInfo, setEventInfo] = useState({childName:'',childAge:'',parentsNames:'',location:'',address:'',coupleNames:'',makingOfLocation:'',ceremonyLocation:'',receptionLocation:'',weddingPlanner:'',plannerContact:'',canPostSocialMedia:'Não',socialMediaHandle:'',tagOnSocialMedia:false});
  const [couponInput, setCouponInput] = useState('');
  const [couponMessage, setCouponMessage] = useState({text:'',type:''});
  const [appliedCoupon, setAppliedCoupon] = useState(null);

  useEffect(() => { setIsStepValid(false); }, [step, selectedEventType]);
  useEffect(() => {
    if (step === 2 && selectedEventType) setStep(3);
    if (step === 4 && selectedPackage) setStep(5);
  }, [step]);

  const { bookedSlotsToday, bookedSlotsTomorrow } = useMemo(() => {
    if (!selectedDate) return {bookedSlotsToday:[],bookedSlotsTomorrow:[]};
    const todayStr = selectedDate.toISOString().split('T')[0];
    const tom = new Date(selectedDate); tom.setDate(tom.getDate()+1);
    const tomStr = tom.toISOString().split('T')[0];
    const sToday = [], sTomorrow = [];
    events.forEach(ev => {
      if (!ev.endDate) return;
      let cur = new Date(ev.date);
      while (cur < ev.endDate) {
        const ds = cur.toISOString().split('T')[0];
        const ts = `${cur.getHours().toString().padStart(2,'0')}:${cur.getMinutes().toString().padStart(2,'0')}`;
        if (ds === todayStr) sToday.push(ts);
        else if (ds === tomStr) sTomorrow.push(ts);
        cur.setMinutes(cur.getMinutes()+30);
      }
    });
    return {bookedSlotsToday:[...new Set(sToday)], bookedSlotsTomorrow:[...new Set(sTomorrow)]};
  }, [selectedDate, events]);

  const currentOffering = selectedEventType ? eventOfferings[selectedEventType] : undefined;
  const subtotal = (selectedPackage?.price||0) + selectedAddons.reduce((s,a) => s+a.price, 0);
  const {finalTotal, discountAmount} = useMemo(() => {
    if (!appliedCoupon) return {finalTotal:subtotal, discountAmount:0};
    let d = appliedCoupon.discountType==='percentage' ? subtotal*(appliedCoupon.discountValue/100) : appliedCoupon.discountValue;
    d = Math.min(d, subtotal);
    return {finalTotal:Math.max(0,subtotal-d), discountAmount:d};
  }, [appliedCoupon, subtotal]);

  const handleApplyCoupon = () => {
    const c = coupons.find(c => c.code.toLowerCase()===couponInput.toLowerCase());
    const now = new Date(); now.setHours(0,0,0,0);
    if (!c) { setCouponMessage({text:'Cupom inválido.',type:'error'}); setAppliedCoupon(null); return; }
    if (!c.isActive) { setCouponMessage({text:'Este cupom não está mais ativo.',type:'error'}); setAppliedCoupon(null); return; }
    if (now < new Date(c.startDate+'T00:00:00')) { setCouponMessage({text:'Este cupom ainda não é válido.',type:'error'}); setAppliedCoupon(null); return; }
    if (now > new Date(c.endDate+'T23:59:59')) { setCouponMessage({text:'Este cupom expirou.',type:'error'}); setAppliedCoupon(null); return; }
    setAppliedCoupon(c); setCouponMessage({text:`Cupom "${c.code}" aplicado!`,type:'success'});
  };

  const toggleAddon = (addon) => {
    const sel = selectedAddons.some(a => a.id===addon.id);
    if (sel) {
      setSelectedAddons(p=>p.filter(a=>a.id!==addon.id));
      if (addon.options) setAddonOptionSelections(p=>{const n={...p};delete n[addon.id];return n;});
    } else {
      setSelectedAddons(p=>[...p,addon]);
      if (addon.options) setAddonOptionSelections(p=>({...p,[addon.id]:addon.options.values[0]}));
    }
  };

  const eventTypesWithIcons = [
    {type:EventType.Casamento, icon:<HeartIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Infantil, icon:<BabyIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Batizado, icon:<DoveIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Aniversario, icon:<GiftIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Ensaio, icon:<CameraIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Corporativo, icon:<BriefcaseIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
  ];

  const contractDateText = useMemo(() => {
    if (!selectedDate||!startTime||!endTime) return '';
    const isOvernight = parseInt(endTime.split(':')[0]) <= parseInt(startTime.split(':')[0]);
    let text = `em ${selectedDate.toLocaleDateString('pt-BR')} das ${startTime} às ${endTime}`;
    if (isOvernight) { const ed=new Date(selectedDate); ed.setDate(ed.getDate()+1); text+=` do dia ${ed.toLocaleDateString('pt-BR')}`; }
    return text;
  }, [selectedDate, startTime, endTime]);

  const steps = ['Data','Tipo','Hora','Pacote','Adicionais','Informações','Contrato','Pagamento'];

  return (
    <div style={{maxWidth:'900px',margin:'0 auto'}}>
      <h1 style={{fontSize:'36px',fontWeight:300,textAlign:'center',color:'white',marginBottom:'8px'}}>Reserve sua Data</h1>
      <p style={{textAlign:'center',color:'#aaa',marginBottom:'48px'}}>Siga os passos para garantir o registro do seu evento.</p>
      
      {/* Step indicator */}
      <div style={{display:'flex',alignItems:'center',marginBottom:'40px',padding:'0 8px'}}>
        {steps.map((name, i) => {
          const sn = i+1;
          const isCompleted = step > sn || (sn===2&&!!initialEventType) || (sn===4&&!!initialPackage);
          const isCurrent = step === sn;
          return (
            <React.Fragment key={name}>
              <button disabled={!isCompleted} onClick={()=>{if(isCompleted){if(initialEventType&&sn===2)return;if(initialPackage&&sn===4)return;setStep(sn);}}}
                style={{display:'flex',alignItems:'center',gap:'6px',background:'none',border:'none',cursor:isCompleted?'pointer':'default',padding:0,flexShrink:0}}>
                <div style={{width:'30px',height:'30px',borderRadius:'50%',display:'flex',alignItems:'center',justifyContent:'center',fontWeight:600,fontSize:'13px',background:isCompleted?'#f9b248':'transparent',color:isCompleted?'#1a1a1a':isCurrent?'#f9b248':'#555',border:isCurrent?'2px solid #f9b248':isCompleted?'none':'2px solid #333',transition:'all 0.2s'}}>
                  {isCompleted ? <CheckIcon style={{width:'14px',height:'14px'}} /> : sn}
                </div>
                <span style={{display:window.innerWidth<600?'none':'inline',fontSize:'13px',color:isCompleted||isCurrent?'white':'#555'}}>{name}</span>
              </button>
              {i < steps.length-1 && <div style={{flex:1,height:'2px',margin:'0 4px',background:step>sn?'#f9b248':'#333',transition:'background 0.3s'}} />}
            </React.Fragment>
          );
        })}
      </div>

      {step === 1 && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'8px'}}>1. Selecione a data do evento</h2>
          <p style={{color:'#aaa',marginBottom:'24px',fontWeight:300}}>Escolha uma data disponível. Dias em vermelho estão ocupados.</p>
          <SimpleCalendar onDateSelect={d=>{setSelectedDate(d);setStep(2);}} bookedDates={events.map(e=>e.date)} />
          <Button variant="secondary" onClick={onNavigateBack} style={{marginTop:'16px'}}>Voltar</Button>
        </Card>
      )}

      {step === 2 && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'24px'}}>2. Qual o tipo de evento?</h2>
          <div style={{display:'grid',gridTemplateColumns:'repeat(3,1fr)',gap:'12px'}}>
            {eventTypesWithIcons.map(({type,icon}) => (
              <button key={type} onClick={()=>{setSelectedEventType(type);setSelectedPackage(null);setSelectedAddons([]);setAddonOptionSelections({});setStep(3);}}
                style={{display:'flex',flexDirection:'column',alignItems:'center',justifyContent:'center',padding:'24px',background:'#121212',border:'1px solid rgba(255,255,255,0.2)',borderRadius:'10px',cursor:'pointer',transition:'all 0.2s',aspectRatio:'1',color:'white'}}
                onMouseEnter={e=>{e.currentTarget.style.border='1px solid #f9b248';e.currentTarget.style.background='#1e1e1e'}}
                onMouseLeave={e=>{e.currentTarget.style.border='1px solid rgba(255,255,255,0.2)';e.currentTarget.style.background='#121212'}}>
                {icon}
                <span style={{fontWeight:300,fontSize:'15px'}}>{type}</span>
              </button>
            ))}
          </div>
          <Button variant="secondary" onClick={()=>setStep(1)} style={{marginTop:'24px'}}>Voltar</Button>
        </Card>
      )}

      {step === 3 && selectedDate && (
        <Card>
          <TimeSlotSelector selectedDate={selectedDate} onTimeSelect={(s,e)=>{setStartTime(s);setEndTime(e);setStep(4);}} onBack={()=>setStep(initialEventType?1:2)} bookedSlotsToday={bookedSlotsToday} bookedSlotsTomorrow={bookedSlotsTomorrow} />
        </Card>
      )}

      {step === 4 && currentOffering && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'24px'}}>4. Escolha seu pacote para <span style={{color:'#f9b248'}}>{selectedEventType}</span></h2>
          <div style={{display:'grid',gridTemplateColumns:'repeat(3,1fr)',gap:'16px'}}>
            {currentOffering.packages.map(pkg => (
              <div key={pkg.id} style={{background:'#121212',padding:'20px',borderRadius:'10px',border:'1px solid rgba(255,255,255,0.15)',display:'flex',flexDirection:'column',transition:'border-color 0.2s',cursor:'pointer'}}
                onMouseEnter={e=>e.currentTarget.style.borderColor='#f9b248'} onMouseLeave={e=>e.currentTarget.style.borderColor='rgba(255,255,255,0.15)'}>
                <h3 style={{fontSize:'18px',color:'#f9b248',fontWeight:400,marginBottom:'8px'}}>{pkg.name}</h3>
                <p style={{fontSize:'28px',fontWeight:600,color:'white',marginBottom:'12px'}}>{pkg.price.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</p>
                <p style={{color:'#aaa',fontSize:'13px',fontWeight:300,flex:1,marginBottom:'12px'}}>{pkg.description}</p>
                {pkg.note && <p style={{fontSize:'11px',color:'rgba(251,191,36,0.8)',fontStyle:'italic',marginBottom:'12px'}}>{pkg.note}</p>}
                <ul style={{listStyle:'none',padding:0,margin:'0 0 16px 0',fontSize:'13px',color:'#ddd'}}>
                  {pkg.features.map(f=><li key={f} style={{display:'flex',alignItems:'center',gap:'6px',marginBottom:'6px'}}><CheckIcon style={{width:'14px',height:'14px',color:'#4ade80',flexShrink:0}} />{f}</li>)}
                </ul>
                <Button onClick={()=>{setSelectedPackage(pkg);setStep(5);}}>Selecionar</Button>
              </div>
            ))}
          </div>
          <Button variant="secondary" onClick={()=>setStep(3)} style={{marginTop:'24px'}}>Voltar</Button>
        </Card>
      )}

      {step === 5 && selectedPackage && currentOffering && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'8px'}}>5. Adicionais</h2>
          <p style={{color:'#aaa',marginBottom:'24px',fontWeight:300}}>Adicione serviços opcionais para complementar sua reserva.</p>
          <div style={{display:'flex',flexDirection:'column',gap:'10px'}}>
            {currentOffering.addons.map(addon => {
              const sel = selectedAddons.some(a=>a.id===addon.id);
              return (
                <div key={addon.id} style={{padding:'14px 16px',background:'#121212',border:`1px solid ${sel?'#f9b248':'rgba(255,255,255,0.15)'}`,borderRadius:'10px',transition:'border-color 0.2s'}}>
                  <label style={{display:'flex',alignItems:'center',justifyContent:'space-between',cursor:'pointer'}}>
                    <div style={{flex:1}}>
                      <span style={{color:'white',fontWeight:400}}>{addon.name}</span>
                      {addon.description && <span style={{color:'#aaa',fontSize:'12px',display:'block',fontWeight:300}}>{addon.description}</span>}
                      <span style={{color:'#f9b248',fontSize:'13px',display:'block',marginTop:'2px'}}>{addon.price.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</span>
                    </div>
                    <input type="checkbox" checked={sel} onChange={()=>toggleAddon(addon)} style={{width:'18px',height:'18px',cursor:'pointer',accentColor:'#f9b248'}} />
                  </label>
                  {addon.options && sel && (
                    <div style={{marginTop:'10px',paddingTop:'10px',borderTop:'1px solid rgba(255,255,255,0.1)'}}>
                      <Select label={addon.options.label} id={`ao-${addon.id}`} value={addonOptionSelections[addon.id]||''} onChange={e=>setAddonOptionSelections(p=>({...p,[addon.id]:e.target.value}))}>
                        {addon.options.values.map(v=><option key={v} value={v}>{v}</option>)}
                      </Select>
                    </div>
                  )}
                </div>
              );
            })}
          </div>
          <div style={{borderTop:'1px solid rgba(255,255,255,0.15)',paddingTop:'20px',marginTop:'24px',display:'flex',justifyContent:'space-between',alignItems:'center'}}>
            <div>
              <p style={{color:'#aaa',fontSize:'13px',fontWeight:300}}>Subtotal:</p>
              <p style={{fontSize:'28px',fontWeight:600,color:'white'}}>{subtotal.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</p>
            </div>
            <div style={{display:'flex',gap:'12px'}}>
              <Button variant="secondary" onClick={()=>setStep(initialPackage?3:4)}>Voltar</Button>
              <Button onClick={()=>setStep(6)}>Próximo</Button>
            </div>
          </div>
        </Card>
      )}

      {step === 6 && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'24px'}}>6. Informações do Evento</h2>
          {selectedEventType === EventType.Casamento && <CasamentoForm info={eventInfo} setInfo={setEventInfo} setIsValid={setIsStepValid} />}
          {(selectedEventType === EventType.Infantil || selectedEventType === EventType.Batizado) && <InfantilBatizadoForm info={eventInfo} setInfo={setEventInfo} setIsValid={setIsStepValid} />}
          {(selectedEventType !== EventType.Casamento && selectedEventType !== EventType.Infantil && selectedEventType !== EventType.Batizado) && <p style={{color:'#aaa'}}>Preencha as informações adicionais sobre seu evento se necessário.</p>}
          <div style={{display:'flex',justifyContent:'space-between',marginTop:'24px'}}>
            <Button variant="secondary" onClick={()=>setStep(5)}>Voltar</Button>
            <Button onClick={()=>setStep(7)} disabled={!isStepValid && (selectedEventType===EventType.Casamento||selectedEventType===EventType.Infantil||selectedEventType===EventType.Batizado)}>Próximo</Button>
          </div>
        </Card>
      )}

      {step === 7 && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'24px'}}>7. Contrato de Prestação de Serviços</h2>
          <div style={{height:'220px',overflowY:'auto',padding:'16px',background:'#121212',border:'1px solid rgba(255,255,255,0.15)',borderRadius:'8px',fontSize:'13px',color:'#aaa',lineHeight:1.7,marginBottom:'16px'}}>
            <p style={{fontWeight:600,color:'white',marginBottom:'12px'}}>CONTRATO DE PRESTAÇÃO DE SERVIÇOS FOTOGRÁFICOS</p>
            <p><strong>Cláusula 1: Objeto.</strong> O presente contrato tem por objeto a prestação de serviços de cobertura fotográfica do evento {`"${selectedEventType}"`} a ser realizado {contractDateText}.</p>
            <p style={{marginTop:'8px'}}><strong>Cláusula 2: Pacote e Serviços.</strong> O CONTRATANTE adquire o pacote "{selectedPackage?.name}" que inclui: {selectedPackage?.features.join(', ')}. Serviços adicionais: {selectedAddons.length>0?selectedAddons.map(a=>a.name).join(', '):'Nenhum'}.</p>
            <p style={{marginTop:'8px'}}><strong>Cláusula 3: Detalhes do Evento.</strong> Nome(s): {eventInfo.coupleNames||eventInfo.childName||'N/A'}. Local: {eventInfo.location||eventInfo.ceremonyLocation||'N/A'}.</p>
            <p style={{marginTop:'8px'}}><strong>Cláusula 4: Valor e Pagamento.</strong> O valor total dos serviços é de {finalTotal.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}.</p>
            <p style={{marginTop:'8px'}}>... demais cláusulas sobre entrega, direitos de imagem, cancelamento, etc.</p>
          </div>
          <Input label="Digite seu nome completo para assinar" id="sig" placeholder="Seu Nome Completo" style={{marginBottom:'12px'}} />
          <label style={{display:'flex',alignItems:'center',gap:'10px',color:'white',cursor:'pointer',fontWeight:300}}>
            <input type="checkbox" style={{width:'18px',height:'18px',accentColor:'#f9b248'}} /> Li e concordo com os termos do contrato.
          </label>
          <div style={{display:'flex',justifyContent:'space-between',marginTop:'24px'}}>
            <Button variant="secondary" onClick={()=>setStep(6)}>Voltar</Button>
            <Button onClick={()=>setStep(8)}>Assinar e Pagar</Button>
          </div>
        </Card>
      )}

      {step === 8 && (
        <Card>
          <h2 style={{fontSize:'22px',fontWeight:300,textAlign:'center',color:'white',marginBottom:'32px'}}>8. Pagamento</h2>
          <div style={{maxWidth:'400px',margin:'0 auto'}}>
            <div style={{background:'#121212',padding:'20px',borderRadius:'10px',marginBottom:'24px'}}>
              <div style={{display:'flex',justifyContent:'space-between',color:'#aaa',fontSize:'14px',marginBottom:'8px'}}><span>Subtotal</span><span>{subtotal.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</span></div>
              {appliedCoupon && <div style={{display:'flex',justifyContent:'space-between',color:'#4ade80',fontSize:'14px',marginBottom:'8px'}}><span>Desconto ({appliedCoupon.code})</span><span>-{discountAmount.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</span></div>}
              <div style={{display:'flex',justifyContent:'space-between',fontWeight:600,fontSize:'22px',color:'white',paddingTop:'12px',borderTop:'1px solid rgba(255,255,255,0.1)'}}><span>Total</span><span>{finalTotal.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</span></div>
            </div>
            {!appliedCoupon ? (
              <div style={{display:'flex',gap:'8px',marginBottom:'16px'}}>
                <div style={{flex:1}}><Input label="Código do Cupom" id="coupon-code" value={couponInput} onChange={e=>setCouponInput(e.target.value)} placeholder="Ex: BEMVINDO15" /></div>
                <Button onClick={handleApplyCoupon} style={{marginTop:'22px',padding:'8px 16px'}}>Aplicar</Button>
              </div>
            ) : (
              <div style={{textAlign:'center',marginBottom:'16px'}}>
                <p style={{color:'#4ade80',marginBottom:'4px'}}>{couponMessage.text}</p>
                <button onClick={()=>{setAppliedCoupon(null);setCouponInput('');setCouponMessage({text:'',type:'',});}} style={{color:'#f87171',background:'none',border:'none',cursor:'pointer',fontSize:'13px',textDecoration:'underline'}}>Remover Cupom</button>
              </div>
            )}
            {couponMessage.text && !appliedCoupon && <p style={{color:'#f87171',fontSize:'13px',textAlign:'center',marginBottom:'12px'}}>{couponMessage.text}</p>}
            <div style={{display:'flex',justifyContent:'center',gap:'16px',marginBottom:'16px'}}>
              {['Pix', 'Cartão de Crédito'].map(m => (
                <button key={m} onClick={onBookingComplete} style={{width:'160px',height:'90px',background:'rgba(249,178,72,0.1)',border:'2px solid rgba(249,178,72,0.4)',borderRadius:'10px',color:'white',cursor:'pointer',display:'flex',flexDirection:'column',alignItems:'center',justifyContent:'center',gap:'8px',fontSize:'14px',fontWeight:600,transition:'all 0.2s'}}
                  onMouseEnter={e=>{e.currentTarget.style.background='#f9b248';e.currentTarget.style.color='#1a1a1a'}}
                  onMouseLeave={e=>{e.currentTarget.style.background='rgba(249,178,72,0.1)';e.currentTarget.style.color='white'}}>
                  <span style={{fontSize:'24px'}}>{m==='Pix'?'⚡':'💳'}</span>{m}
                </button>
              ))}
            </div>
            <div style={{display:'flex',justifyContent:'center'}}>
              <Button variant="secondary" onClick={()=>setStep(7)}>Voltar</Button>
            </div>
          </div>
        </Card>
      )}
    </div>
  );
}

// ===================== PACKAGES VIEW =====================
function PackagesView({ onPackageSelected, onBack, eventOfferings }) {
  const [selectedEventType, setSelectedEventType] = useState(null);
  const eventTypesWithIcons = [
    {type:EventType.Casamento, icon:<HeartIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Infantil, icon:<BabyIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Batizado, icon:<DoveIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Aniversario, icon:<GiftIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Ensaio, icon:<CameraIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
    {type:EventType.Corporativo, icon:<BriefcaseIcon style={{width:'40px',height:'40px',marginBottom:'12px',color:'#f9b248'}} />},
  ];
  if (!selectedEventType) return (
    <div style={{maxWidth:'900px',margin:'0 auto'}}>
      <h1 style={{fontSize:'36px',fontWeight:300,textAlign:'center',color:'white',marginBottom:'8px'}}>Pacotes e Preços</h1>
      <p style={{textAlign:'center',color:'#aaa',marginBottom:'48px'}}>Selecione um tipo de evento para ver os pacotes disponíveis.</p>
      <Card>
        <h2 style={{fontSize:'22px',fontWeight:300,color:'white',marginBottom:'24px'}}>1. Qual o tipo de evento?</h2>
        <div style={{display:'grid',gridTemplateColumns:'repeat(3,1fr)',gap:'12px'}}>
          {eventTypesWithIcons.map(({type,icon}) => (
            <button key={type} onClick={()=>setSelectedEventType(type)}
              style={{display:'flex',flexDirection:'column',alignItems:'center',justifyContent:'center',padding:'24px',background:'#121212',border:'1px solid rgba(255,255,255,0.2)',borderRadius:'10px',cursor:'pointer',transition:'all 0.2s',aspectRatio:'1',color:'white'}}
              onMouseEnter={e=>{e.currentTarget.style.border='1px solid #f9b248';e.currentTarget.style.background='#1e1e1e'}}
              onMouseLeave={e=>{e.currentTarget.style.border='1px solid rgba(255,255,255,0.2)';e.currentTarget.style.background='#121212'}}>
              {icon}
              <span style={{fontWeight:300,fontSize:'15px'}}>{type}</span>
            </button>
          ))}
        </div>
        <Button variant="secondary" onClick={onBack} style={{marginTop:'24px'}}>Voltar para Home</Button>
      </Card>
    </div>
  );

  const offering = eventOfferings[selectedEventType];
  return (
    <div style={{maxWidth:'900px',margin:'0 auto'}}>
      <h1 style={{fontSize:'36px',fontWeight:300,textAlign:'center',color:'white',marginBottom:'8px'}}>Pacotes de {selectedEventType}</h1>
      <p style={{textAlign:'center',color:'#aaa',marginBottom:'48px'}}>Escolha o pacote ideal e clique em "Selecionar e Agendar" para continuar.</p>
      <Card>
        <div style={{display:'grid',gridTemplateColumns:'repeat(3,1fr)',gap:'16px'}}>
          {offering.packages.map(pkg => (
            <div key={pkg.id}
              onMouseEnter={e=>e.currentTarget.style.borderColor='#f9b248'} onMouseLeave={e=>e.currentTarget.style.borderColor='rgba(255,255,255,0.15)'} style={{background:'#121212',padding:'20px',borderRadius:'10px',border:'1px solid rgba(255,255,255,0.15)',display:'flex',flexDirection:'column',transition:'border-color 0.2s'}}>
              <h3 style={{fontSize:'18px',color:'#f9b248',fontWeight:400,marginBottom:'8px'}}>{pkg.name}</h3>
              <p style={{fontSize:'28px',fontWeight:600,color:'white',marginBottom:'12px'}}>{pkg.price.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</p>
              <p style={{color:'#aaa',fontSize:'13px',fontWeight:300,flex:1,marginBottom:'12px'}}>{pkg.description}</p>
              {pkg.note && <p style={{fontSize:'11px',color:'rgba(251,191,36,0.8)',fontStyle:'italic',marginBottom:'12px'}}>{pkg.note}</p>}
              <ul style={{listStyle:'none',padding:0,margin:'0 0 16px 0',fontSize:'13px',color:'#ddd'}}>
                {pkg.features.map(f=><li key={f} style={{display:'flex',alignItems:'center',gap:'6px',marginBottom:'6px'}}><CheckIcon style={{width:'14px',height:'14px',color:'#4ade80',flexShrink:0}} />{f}</li>)}
              </ul>
              <Button onClick={()=>onPackageSelected(selectedEventType,pkg)}>Selecionar e Agendar</Button>
            </div>
          ))}
        </div>
        <Button variant="secondary" onClick={()=>setSelectedEventType(null)} style={{marginTop:'24px'}}>Voltar para Tipos de Evento</Button>
      </Card>
    </div>
  );
}

// ===================== ADMIN LAYOUT =====================
function AdminLayout({ children, activeView, setActiveView }) {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const navItems = [
    {id:'dashboard', text:'Dashboard', icon:<BarChartIcon style={{width:'18px',height:'18px'}} />},
    {id:'agenda', text:'Agenda', icon:<CalendarIcon style={{width:'18px',height:'18px'}} />},
    {id:'events', text:'Eventos', icon:<PackageIcon style={{width:'18px',height:'18px'}} />},
    {id:'pending', text:'Pendências', icon:<AlertIcon style={{width:'18px',height:'18px'}} />},
    {id:'clients', text:'Clientes', icon:<UsersIcon style={{width:'18px',height:'18px'}} />},
    {id:'financials', text:'Financeiro', icon:<DollarIcon style={{width:'18px',height:'18px'}} />},
    {id:'settings', text:'Configurações', icon:<SettingsIcon style={{width:'18px',height:'18px'}} />},
  ];
  const SidebarContent = () => (
    <div style={{padding:'16px'}}>
      <button onClick={()=>{setActiveView('dashboard');setSidebarOpen(false);}} style={{background:'none',border:'none',cursor:'pointer',width:'100%',textAlign:'left',marginBottom:'32px',padding:'0 16px'}}>
        <h2 style={{fontSize:'22px',fontWeight:600,color:'white'}}>Momentu<span style={{color:'#f9b248'}}>.</span><span style={{fontSize:'11px',fontWeight:300,color:'#aaa',marginLeft:'2px'}}>admin</span></h2>
      </button>
      <nav>
        {navItems.map(item => (
          <div key={item.id} onClick={()=>{setActiveView(item.id);setSidebarOpen(false);}}
            style={{display:'flex',alignItems:'center',gap:'12px',padding:'10px 16px',borderRadius:'8px',cursor:'pointer',marginBottom:'4px',background:activeView===item.id?'#f9b248':'transparent',color:activeView===item.id?'#1a1a1a':'#aaa',fontWeight:activeView===item.id?600:400,fontSize:'14px',transition:'all 0.2s'}}
            onMouseEnter={e=>{if(activeView!==item.id){e.currentTarget.style.background='rgba(255,255,255,0.05)';e.currentTarget.style.color='white';}}}
            onMouseLeave={e=>{if(activeView!==item.id){e.currentTarget.style.background='transparent';e.currentTarget.style.color='#aaa';}}}>
            {item.icon}{item.text}
          </div>
        ))}
      </nav>
    </div>
  );
  return (
    <div style={{minHeight:'100vh',display:'flex',background:'#121212'}}>
      {sidebarOpen && <div onClick={()=>setSidebarOpen(false)} style={{position:'fixed',inset:0,background:'rgba(0,0,0,0.6)',zIndex:30}} />}
      <aside style={{position:'fixed',top:0,left:0,height:'100%',width:'240px',background:'#1e1e1e',borderRight:'1px solid rgba(255,255,255,0.08)',transform:sidebarOpen?'translateX(0)':'translateX(-100%)',zIndex:40,transition:'transform 0.25s',display:'flex',flexDirection:'column'}}>
        <SidebarContent />
      </aside>
      <aside style={{display:'none',width:'240px',background:'#1e1e1e',borderRight:'1px solid rgba(255,255,255,0.08)',flexShrink:0}} className="lg-sidebar">
        <SidebarContent />
      </aside>
      <main style={{flex:1,padding:'24px',overflowY:'auto',marginLeft:'0'}}>
        <button onClick={()=>setSidebarOpen(true)} style={{background:'none',border:'none',color:'white',cursor:'pointer',marginBottom:'16px',padding:'4px'}}><MenuIcon style={{width:'24px',height:'24px'}} /></button>
        {children}
      </main>
      <style>{`.lg-sidebar { display: none; } @media(min-width:1024px){.lg-sidebar{display:flex!important;flex-direction:column} aside[style*="-100%"]{transform:none!important;position:static!important;z-index:auto!important} main{padding:32px!important;} button[style*="margin-bottom: 16px"]{display:none!important}}`}</style>
    </div>
  );
}

